import React from "react";
import '../../FormStyling.css';
function FieldTypeTextarea(props) {

    let config = props.config;

    return (<>
        <label>{config.Text}</label>
        {

            (config.InformationList) && config.InformationList.map(listItem => {
                return <li key={listItem}>{listItem}</li>
            })

        }
        <p><textarea name="message" placeholder={config.Placeholder} /></p>
    </>
    );
}

export default FieldTypeTextarea;
